import React, {Component} from "react";

const Context = React.createContext();

export class Provider extends Component {
    state = {
        athletes: [
            {
                id: 1,
                firstName: "Pekka",
                lastName: "Routalempi",
            },
            {
                id: 2,
                firstName: "Rauno",
                lastName: "Repomies",
            },
        ],
    }

    render () {
        return (
            <Context.Provider value={this.state}>
                {this.props.children}
            </Context.Provider>
        );
    }
}

export const Consumer = Context.Consumer;
